import React from 'react';

const toolbar = props => (
    <header>
        <nav>
            <div></div>
            <div><a href="/">Sailboat</a></div>
            <div>
                <ul>
                    <li><a href="/">Login</a></li>
                </ul>
            </div>
        </nav>
    </header>
);

export default toolbar;
